description:
Artic Chipper Chat is now a Chipper Chat favorite! You & your students can join in the celebration as you welcome this articulation & language game into your classroom! What makes Artic Chipper Chat unique? It has 12 different laminated game boards, each one filled with sound & blend-loaded pictures (5 of each scene for 60 boards total). Students pick up question cards ("Name a flower that rhymes w/nose") & search their boards for the correct picture answer ("rose"). As they answer questions, players fill up their boards w/magnetic chips. When the boards are full, each child waves the "magic" wand over the board & collects the magnetic rewards.

As an articulation game, Artic Chipper Chat:

 * Targets 12 different sounds-S, R, L, S Blends, R Blends, L Blends, SH, CH, TH, F, K, & G; 
 * Has 450 double-sided playing cards (one side with the question and the other side with a picture of the answer); 
 * Allows students to play at the initial, medial, final, &/or combo level.

Artic Chipper Chat is also a language game that targets:

 * Vocabulary Building: Exposure to & practice of 450 nouns; 
 * Simple Analogies: "A monkey eats a banana. A rabbit eats a carrot."; 
 * Naming: "Name the jewelry that you wear on your finger...Ring."; 
 * Phonemic Awareness: Targets early rhyming skills; 
 * Listening Skills: Auditory processing of information presented orally; 
 * Social Skills: Turn-taking, topic maintenance, & sharing information; 

Artic Chipper Chat includes:

 * 60 beautiful, individual game boards (5 each of 12 different scenes).; 
 * Big 11" x 10", laminated game boards; 
 * 450 laminated, colorful Artic Chipper Chat cards - 45 cards each for S, R, L, SH, CH, & TH (15 initial, 15 medial, & 15 final position); 30 cards each for S Blends, R Blends, & L Blends (initial position only); 30 cards each for K, G, & F (10 initial, 10 medial, & 10 final position); 
 * Magnetic wand & 100 magnetic chips; 
 * Die, instruction booklet, & sturdy plastic tote.
